import React from "react";
import TopBanner from "../../components/TopBanner";
import MuiThemeProvider from '@material-ui/core/styles/MuiThemeProvider';
import { TextField } from "@material-ui/core";
import Grid from '@material-ui/core/Grid';
import { Button } from "@material-ui/core";

const ReachOut = () => {
return (
    <>
        <TopBanner />
        <MuiThemeProvider>
            <div style = {{margin: "50px auto", maxWidth: "500px"}}>
                <Grid container direction={"column"} spacing={15}>
                    <Grid item>
                        <TextField label = "FirstName" placeholder = "Please enter your first name." fullWidth = "true" variant="outlined"/>
                    </Grid>
                    <br />
                    <br />
                    <Grid item>
                        <TextField label = "LastName" placeholder = "Please enter your last name." fullWidth = "true" variant="outlined"/>
                    </Grid>
                    <br />
                    <br />
                    <Grid item>
                        <TextField label = "Email" placeholder = "Please enter your email ID." fullWidth = "true" />
                    </Grid>
                    <br />
                    <br />
                    <Grid item>
                        <TextField label = "Message" placeholder = "I'd love to hear from you!" fullWidth = "true" />
                    </Grid>
                    <br />
                </Grid>
                <Button color = "primary" variant = "contained">Submit</Button>
            </div>
            
        </MuiThemeProvider>
    </>
)
};

    export default ReachOut;
